import React, { useState } from 'react';
import logo from '../../assets/images/logo1.png';
import user from '../../assets/images/default.png';

function Sidebar() {
  const [click, setClick] = useState("dashboard");

  function handleClick(value) {
    setClick(value);
  }

  return ( 
    <section id="sidebar">
      <a href="/restaurant" className="brand">
        <img src={logo} alt="Logo" />
        <span className="text">Booking Restaurant</span>
      </a>
      <a href="#" className="account">
        <img src={user} alt="User" />
        <span className="text">Hoa Ngao</span>
      </a>
      <ul className="side-menu top">
        <li className={click === "dashboard" ? "active" : ""} onClick={() => handleClick("dashboard")}>
          <i className="fab fa-windows"></i>
          <span className="text">Dashboard</span>
        </li>
        <li className={click === "dish" ? "active" : ""} onClick={() => handleClick("dish")}>
          <i className="nav-icon fas fa-hamburger"></i>
          <span className="text">The Dishes</span>
        </li>
        <li className={click === "table" ? "active" : ""} onClick={() => handleClick("table")}>
          <i className="nav-icon fas fa-chair"></i>
          <span className="text">The Tables</span>
        </li>
        <li className={click === "message" ? "active" : ""} onClick={() => handleClick("message")}>
          <i className="nav-icon far fa-comment-dots"></i>
          <span className="text">Chat Messages</span>
        </li>
        <li className={click === "review" ? "active" : ""} onClick={() => handleClick("review")}>
          <i className="nav-icon fas fa-comments"></i>
          <span className="text">Reviewes</span>
        </li>
        <li className={click === "contact" ? "active" : ""} onClick={() => handleClick("contact")}>
          <i className="nav-icon fas fa-comments"></i>
          <span className="text">Contact Us</span>
        </li>
      </ul>
      <a className="menu-other">Others</a>
      <ul className="side-menu">
        <li className={click === "setting" ? "active" : ""} onClick={() => handleClick("setting")}>
          <i className="fas fa-cog"></i>
          <span className="text">Setting</span>
        </li>
        <li>
          <i className="fas fa-sign-out"></i>
          <span className="text">Logout</span>
        </li>
      </ul>
    </section>
  );
}

export default Sidebar;
